import React from "react";

export default function About() {

    const portrait = require('./images/profile_pic.png');

    return (
        <section id="about-me" class="main-content">
            <div id="about-section-title" class="section-title">
                <h2>About me</h2>
            </div>
            <div id="personal-info-container">
                <div id="personal-info">
                    <p>I am a PhD graduate and a self-taught web developer!</p>
                    <p>I also have experience in scientific computation and developing machine learning models for classification tasks.</p>
                </div>

                <div id="prof-pic-container">
                    <img src={portraits} alt="Portrait shot of me" id="profile-pic" />
                </div>
            </div>
        </section>

    )
}
